import React from 'react'
import ToDoSpan from "../to-do-span";
import TaskFilter from "./TasksFilter/task-filter";
import './footer.css'


const Footer = () => {
    return (
        <footer className="footer">
           <ToDoSpan className="todo-count" label="1 items left"/>
            <TaskFilter/>
            <ToDoSpan className="clear-completed" label="Clear completed"/>
        </footer>
    );
}


export default Footer;
